INSERT INTO `sys_oper_log` VALUES (566, '【请填写功能名称】', 2, 'com.ruoyi.project.websitecenternews.controller.TbWebsiteCenterNewsController.editSave()', 'POST', 1, 'admin', '超级管理员', '/website/centernews/edit', '192.168.0.156', '内网IP', '{\"id\":[\"4\"],\"centerNews\":[\"各学院：\\r\\n\\r\\n教学督导是为适应教学改革和发展之需要，对教学秩序、教学工作实施监督与指导的一项重要举措，也是我校教学质量监控体系中的重要组成部分。我校教学督导委员会自建立以来，在分管校长领导下，配合学校教学职能部门对全校的教学质量、教学管理和教学秩序进行检查、督促、指导和反馈，对我校教学工作的改进、教学质量的提高发挥了重要作用。\\r\\n\\r\\n现根据工作需要和计划安排，学校决定启动换届工作，具体相关事项通知如下：\\r\\n\\r\\n一、学校教学督导的组织架构\\r\\n\\r\\n1．各学院应设教学督导组，一般由3-5名成员组成。\\r\\n\\r\\n2．校教学督导委员会成员原则上由各学院的教学督导组长与部分从事高等教育研究的专家组成。\\r\\n\\r\\n二、教学督导人员的选拔要求\\r\\n\\r\\n1．在职人员应具较高群众威望和教学水平，并有教授职称（或有博士学位的副教授），退休人员应为近年离退休的教授或学院老领导；能切实有效地指导青年教师课堂教学工作。\\r\\n\\r\\n2．为了确保教学督导队伍的成员都能有充沛的精力履行工作职责，已离退休的教师与干部的年龄原则上不应大于67周岁（即1952年7月以后出生），且没有担任过多的其他社会兼职。\\r\\n\\r\\n3．工作认真负责，乐于奉献。\\r\\n\\r\\n三、选拔程序\\r\\n\\r\\n1．各学院按照本通知关于教学督导人员的选拔要求，于4月15日之前提出学院教学督导组成员人选名单（见附件）并报本科教学部备案。\\r\\n\\r\\n2．本科教学部根据各学院上报的院级教学督导组名单，提出校教学督导委员会组成方案。\\r\\n\\r\\n3．学校正式发文公布校教学督导委员会组成人员。\\r\\n\\r\\n四、教学督导人员工作的基本要求\\r\\n\\r\\n1．认真履行教学督导工作条例的相关规定。\\r\\n\\r\\n2．每学期听课时数不少于16节。\\r\\n\\r\\n3．每学年至少参与一个教学专题的研究。\\r\\n\\r\\n4．其他的教学检查与督导工作。\"]}', '{\"msg\":\"操作成功\",\"code\":0}', 0, NULL, '2019-10-23 15:05:59');
INSERT INTO `sys_oper_log` VALUES (567, '【请填写功能名称】', 2, 'com.ruoyi.project.websitecenternews.controller.TbWebsiteCenterNewsController.editSave()', 'POST', 1, 'admin', '超级管理员', '/website/centernews/edit', '192.168.0.156', '内网IP', '{\"id\":[\"4\"],\"centerNews\":[\"教学督导是为适应教学改革和发展之需要，对教学秩序、教学工作实施监督与指导的一项重要举措，也是我校教学质量监控体系中的重要组成部分。我校教学督导委员会自建立以来，在分管校长领导下，配合学校教学职能部门对全校的教学质量、教学管理和教学秩序进行检查、督促、指导和反馈，对我校教学工作的改进、教学质量的提高发挥了重要作用。\"]}', '{\"msg\":\"操作成功\",\"code\":0}', 0, NULL, '2019-10-23 15:07:22');
