INSERT INTO `tb_website_center_news` VALUES (4, '教学督导是为适应教学改革和发展之需要，对教学秩序、教学工作实施监督与指导的一项重要举措，也是我校教学质量监控体系中的重要组成部分。我校教学督导委员会自建立以来，在分管校长领导下，配合学校教学职能部门对全校的教学质量、教学管理和教学秩序进行检查、督促、指导和反馈，对我校教学工作的改进、教学质量的提高发挥了重要作用。', '2019-10-21 10:08:23', '2019-10-23 15:07:22');
INSERT INTO `tb_website_experiment_team` VALUES (1, '<div class=\"intro_title2\" style=\"text-align: left; font-weight: bold; margin-bottom: 10px; margin-top: 20px; font-family: Verdana; font-size: 14px; background-color: rgb(249, 249, 249);\">一、实验队伍规划、建设</div><p style=\"text-align: left; text-indent: 2em; margin-top: 5px; margin-bottom: 5px; padding: 0px; font-family: Verdana; font-size: 14px; background-color: rgb(249, 249, 249);\">1、学校特别重视实验教学队伍的规划和建设，激励有教学经验的教师走到实验教学的第一线，进一步整合实验教学和实验队伍资源，调整实验室布局，更好地适应学科发展和学生培养要求。制订实验室发展和实验队伍建设长期规划，明确目标，促进实验教学发展和改革，稳定实验队伍，全面提升实验人员教学、科研与技术能力。</p><p style=\"text-align: left; text-indent: 2em; margin-top: 5px; margin-bottom: 5px; padding: 0px; font-family: Verdana; font-size: 14px; background-color: rgb(249, 249, 249);\">2、在整合现有教学实验教师资源的基础上，为实验室配置专职的教师（或雇员），该教师（或雇员）的日常工作就是负责管理实验室，配合理论教学教师进行实验教学；目前，中心有实验技术人员（雇员）7人（陈昊、申向军、刘晔、吴涛、王召选、林佳利、李雅丽）；中心在这7位实验技术人员的管理下，实验设备完好率高（98%），实验秩序好，实验环境好，实验效果好。</p><p style=\"text-align: left; text-indent: 2em; margin-top: 5px; margin-bottom: 5px; padding: 0px; font-family: Verdana; font-size: 14px; background-color: rgb(249, 249, 249);\">3、计算机实验教学中心拥有一支实力强、素质高、结构合理，具有不同学历层次、年龄层次和职称结构，新老结合起来的实验教学梯队。中心还聘请合作企业技术人员兼职实验老师，为本科生教授实验。中心全体实验教学人员敬业爱岗，团结合作，具有严谨的工作作风和良好的专业基础知识及相关知识，了解计算机实验的理论和实验原理以及实验设计和创新方法；具有很强的实验教学和管理的能力。</p><div class=\"intro_title2\" style=\"text-align: left; font-weight: bold; margin-bottom: 10px; margin-top: 20px; font-family: Verdana; font-size: 14px; background-color: rgb(249, 249, 249);\">二、实验队伍建设政策措施</div><p style=\"text-align: left; text-indent: 2em; margin-top: 5px; margin-bottom: 5px; padding: 0px; font-family: Verdana; font-size: 14px; background-color: rgb(249, 249, 249);\">1、学校制定了一系列实验教学队伍建设的政策和措施（详见<a href=\"http://sbc.szu.edu.cn/gzzd/gzzdsys_index.html\" target=\"_blank\" class=\"bold\" style=\"font-weight: bold; color: black; font-size: 10px;\">http://sbc.szu.edu.cn/gzzd/gzzdsys_index.html</a>&nbsp;），包括：深圳大学教学实验中心管理办法，深圳大学实验技术人员岗位职责与考核办法，深圳大学实验室考核评比条例，深圳大学实验技术成果评审奖励管理办法等规章制度。</p><p style=\"text-align: left; text-indent: 2em; margin-top: 5px; margin-bottom: 5px; padding: 0px; font-family: Verdana; font-size: 14px; background-color: rgb(249, 249, 249);\">2、奖励教师完成的实验教学成果、论文、实验指导书等，奖励在各种竞赛中获得名次学生和在公开刊物上发表论文学生的指导教师。</p><div class=\"intro_title2\" style=\"text-align: left; font-weight: bold; margin-bottom: 10px; margin-top: 20px; font-family: Verdana; font-size: 14px; background-color: rgb(249, 249, 249);\">三、实验队伍培训制度措施</div><p style=\"text-align: left; text-indent: 2em; margin-top: 5px; margin-bottom: 5px; padding: 0px; font-family: Verdana; font-size: 14px; background-color: rgb(249, 249, 249);\">学校专门出台了实验队伍培训管理办法（深圳大学实验技术人员培训管理办法，（详见表1-20）），对实验人员培训和继续深造提供经费支持，实验技术人员的培训，以在职、在岗的方式参加短期进修班、培训班为主；以通过在职进修、系统学习以及学历培养为辅，少部分人员可以考虑安排脱产进修，重点培养；目前，在现有的7名专职实验技术人员中，具有硕士学位教师的有3人，高级工程师1人，另外2人正在攻读工程硕士学位。为了进一步提高实验教学水平、管理水平，中心定期送实验教学人员到兄弟学校（包括英国兰开夏大学等）进行实验教学的交流工作。。。</p>\n                    ', '2019-10-22 14:53:29', '2019-10-22 18:12:19');
