INSERT INTO `tb_website_management` VALUES (1, '<p style=\"margin-top: 1em; margin-bottom: 1em; unicode-bidi: embed; color: rgb(51, 51, 51); font-family: sans-serif; font-size: 14px;\"><span style=\"margin: 0px; font-weight: bolder;\">质量管理体系应具有符合性</span></p><p style=\"margin-top: 1em; margin-bottom: 1em; unicode-bidi: embed; color: rgb(51, 51, 51); font-family: sans-serif; font-size: 14px;\">　　欲有效开展<a href=\"https://wiki.mbalib.com/wiki/%E8%B4%A8%E9%87%8F%E7%AE%A1%E7%90%86\" title=\"质量管理\" style=\"margin: 0px; color: rgb(23, 58, 189);\">质量管理</a>，必须设计、建立、实施和保持质量管理体系。<a href=\"https://wiki.mbalib.com/wiki/%E7%BB%84%E7%BB%87\" title=\"组织\" style=\"margin: 0px; color: rgb(23, 58, 189);\">组织</a>的最高管理者对依据<a href=\"https://wiki.mbalib.com/wiki/ISO9001\" title=\"ISO9001\" style=\"margin: 0px; color: rgb(23, 58, 189);\">ISO9001</a><a href=\"https://wiki.mbalib.com/wiki/%E5%9B%BD%E9%99%85%E6%A0%87%E5%87%86\" title=\"国际标准\" style=\"margin: 0px; color: rgb(23, 58, 189);\">国际标准</a>设计、建立、实施和保持质量管理体系的决策负责，对建立合理的<a href=\"https://wiki.mbalib.com/wiki/%E7%BB%84%E7%BB%87%E7%BB%93%E6%9E%84\" title=\"组织结构\" style=\"margin: 0px; color: rgb(23, 58, 189);\">组织结构</a>和提供适宜的资源负责；<a href=\"https://wiki.mbalib.com/wiki/%E7%AE%A1%E7%90%86%E8%80%85%E4%BB%A3%E8%A1%A8\" title=\"管理者代表\" style=\"margin: 0px; color: rgb(23, 58, 189);\">管理者代表</a>和质量职能部门对形成文件的促序的制定和实施、过程的建立和运行负直接责任。</p><p style=\"margin-top: 1em; margin-bottom: 1em; unicode-bidi: embed; color: rgb(51, 51, 51); font-family: sans-serif; font-size: 14px;\">　　<span style=\"margin: 0px; font-weight: bolder;\">质量管理体系应具有惟一性</span></p><p style=\"margin-top: 1em; margin-bottom: 1em; unicode-bidi: embed; color: rgb(51, 51, 51); font-family: sans-serif; font-size: 14px;\">　　质量管理体系的设计和建立，应结合组织的<a href=\"https://wiki.mbalib.com/wiki/%E8%B4%A8%E9%87%8F%E7%9B%AE%E6%A0%87\" title=\"质量目标\" style=\"margin: 0px; color: rgb(23, 58, 189);\">质量目标</a>、产品类别、过程特点和实践经验。因此，不同组织的质量管理体系有不同的特点。</p><p style=\"margin-top: 1em; margin-bottom: 1em; unicode-bidi: embed; color: rgb(51, 51, 51); font-family: sans-serif; font-size: 14px;\">　　<span style=\"margin: 0px; font-weight: bolder;\">质量管理体系应具有系统性</span></p><p style=\"margin-top: 1em; margin-bottom: 1em; unicode-bidi: embed; color: rgb(51, 51, 51); font-family: sans-serif; font-size: 14px;\">　　质量管理体系是相互关联和作用的组合体，包括：①组织结构——合理的组织机构和明确的职责、权限及其协调的关系；②程序——规定到位的形成文件的程序和<a href=\"https://wiki.mbalib.com/wiki/%E4%BD%9C%E4%B8%9A%E6%8C%87%E5%AF%BC%E4%B9%A6\" title=\"作业指导书\" style=\"margin: 0px; color: rgb(23, 58, 189);\">作业指导书</a>，是过程运行和进行活动的依据；③过程——质量管理体系的有效实施，是通过其所需请过程的有效运行来实现的；④资源——必需、充分且适宜的资源包括人员、资金、设施。设备、料件、能源、技术和方法。。</p>\n                    ', '2019-10-22 15:21:06', '2019-10-22 15:21:12');
INSERT INTO `tb_website_teaching_feature` VALUES (2, '<div class=\"col_news_con\" frag=\"面板34\" style=\"color: rgb(59, 59, 59); font-family: &quot;Microsoft Yahei&quot;; font-size: 12px;\"><div frag=\"窗口34\" portletmode=\"simpleColumnName\" class=\"title1\" style=\"font-family: &quot;Microsoft YaHei&quot;; font-size: 14px; line-height: 39px; font-weight: bold; color: rgb(0, 88, 129); border: 0px solid rgb(0, 88, 129); background-repeat: no-repeat; background-position: left center; background-color: rgb(245, 240, 231); text-indent: 20px; height: 39px;\"><span class=\"Column_Name\">教学特色</span></div></div><div frag=\"面板35\" style=\"color: rgb(59, 59, 59); font-family: &quot;Microsoft Yahei&quot;; font-size: 12px;\"><div frag=\"窗口35\" portletmode=\"simpleList\"><div class=\"wp_single wp_column_article\" id=\"wp_column_article\"><div class=\"wp_entry\" style=\"width: 700px; line-height: 1.7em; font-size: 13px; color: rgb(51, 51, 51); overflow: hidden;\"><div class=\"wp_articlecontent\"><div id=\"wp_content_w35_0\" class=\"paging_content\"><p style=\"font-size: 14px; line-height: 25.2px; margin-bottom: 5px; text-indent: 0em;\">　　物理实验教学中心的教学特色为：</p><p style=\"font-size: 14px; line-height: 25.2px; margin-bottom: 5px; text-indent: 0em;\">　　1．在教学模式上：以学生为本，以兴趣为引导，将培养学生兴趣和拓展能力为教学的核心理念，并体现在平凡的教学中，譬如,物理探索实验室和学生创新实验室，即为一部分参与全国挑战杯、电子设计大赛的学生提供了有效的实践场地和指导工作，五年来学生在各类竞赛中获得了好成绩（见成果明细表）。同时学生申请了许多项学校层面上的“大夏杯”研究项目（见成果明细表）。</p><p style=\"font-size: 14px; line-height: 25.2px; margin-bottom: 5px; text-indent: 0em;\">　　2．在教学内容上：因人而异，循序渐进地提高学生的各项实验能力，譬如，将物理系师范班的学生与基地班及其它专业的学生按照教学的需求分别设定教学内容，同时在不同的内容上分别给出相应的思考和拓展方向，编写出了相应的实验讲义（见成果明细表），以使学生能获得有益的知识。</p><p style=\"font-size: 14px; line-height: 25.2px; margin-bottom: 5px; text-indent: 0em;\">　　3．在考核方式和内容上，改变以往单一的考核方式，根据培养目标和社会需求，以多种形式考核学生的综合能力。譬如，面试、演讲、讨论、汇报、卷面答题及写小论文等多种形式来综合衡量学生对知识的接受和掌握程度。</p><p style=\"font-size: 14px; line-height: 25.2px; margin-bottom: 5px; text-indent: 0em;\">　　4．让学生充分利用网络信息的平台和信息技术进行选课、答疑、管理、预习等。</p><p style=\"font-size: 14px; line-height: 25.2px; margin-bottom: 5px; text-indent: 0em;\">　　5．注重培养学生兴趣和探索精神。譬如，在实验教学中注重启发和质疑，同时将一部分传统的演示实验功能进行拓展，使其不仅能起到演示学习的作用，而且能通过各项演示实验的内容来激励学生学习兴趣。另外，实验室随时对学生开放，又可起到学生能在兴趣的驱动下去探索物理学习上的各种奥秘，并体会在兴趣的驱动下去探索知识奥秘的经历和收获，尤其对培养未来能承担教育重任的中学物理教师将是十分重要的。</p><p style=\"font-size: 14px; line-height: 25.2px; margin-bottom: 5px; text-indent: 0em;\">　　6．物理实验教学中心的教师在不断深化的教学改革和长期的建设中，获得了一系列的教学成果（见成果明细表），同时也为实验中心的进一步发展奠定了基础。</p><p style=\"font-size: 14px; line-height: 25.2px; margin-bottom: 5px; text-indent: 0em;\">　　7．物理实验教学中心的教师在教学研究的同时，还积极开展各类教学仪器的研制和开发，以提高和补充实验教学内容上新思想，已有多项实验教学仪器获得了申请专利号（见成果明细表）。</p><p style=\"font-size: 14px; line-height: 25.2px; margin-bottom: 5px; text-indent: 0em;\">　　8．在教师教育方面，实验教学中心紧密结合国家和上海市教学发展的需要，及时将机器人设计制作、数字化信息系统、多媒体课件制作等实验内容引入教学上，使学生能更快、更好地适应目前全国中学物理教学上的改革需求。。。</p></div></div></div></div></div></div>\n\n                    ', '2019-10-22 15:55:50', '2019-10-22 15:55:57');
